ENABLE_OFF := (ENABLE = FALSE);
ENABLE_ON := (ENABLE = TRUE);
STATUS_ON := (STATUS = TRUE);
STATUS_OFF := (STATUS = FALSE);
FIRE_ON := (FIRE = TRUE);
FIRE_OFF := (FIRE = FALSE);

BEEN_RUNNING_OK_LATCH(SET := ENABLE_ON AND STATUS_ON, RESET1 := ENABLE_OFF);
BEEN_RUNNING_OK := BEEN_RUNNING_OK_LATCH.Q1;

ALL_OFF_LATCH(SET := ENABLE_OFF AND STATUS_OFF, RESET1 := ENABLE_ON);
ALL_OFF := ALL_OFF_LATCH.Q1;

START_DELAY_TON(IN := ENABLE_ON, PT := T#30S);
START_DELAY_ON := START_DELAY_TON.Q;

STOP_DELAY_TON(IN := ENABLE_OFF, PT := T#30S);
STOP_DELAY_ON := STOP_DELAY_TON.Q;

ENABLE_TIMER_ON := ((START_DELAY_TON.ET < T#30S AND ENABLE_ON) OR (STOP_DELAY_TON.ET < T#30S AND ENABLE_OFF));

START_DELAY_OFF := NOT START_DELAY_ON;
STOP_DELAY_OFF := NOT STOP_DELAY_ON;
ENABLE_TIMER_OFF := NOT ENABLE_TIMER_ON;
NOT_BEEN_RUNNING_OK := NOT BEEN_RUNNING_OK;
NOT_ALL_OFF := NOT ALL_OFF;

IF (ENABLE_ON AND STATUS_OFF AND FIRE_ON) THEN
	STATE := ET_9STATE_MONITORING.FIRE_STOP;
ELSIF (ENABLE_OFF AND STATUS_ON AND STOP_DELAY_ON AND NOT_BEEN_RUNNING_OK AND NOT_ALL_OFF) THEN
	STATE := ET_9STATE_MONITORING.STOP_FAIL;
ELSIF (ENABLE_ON AND STATUS_OFF AND START_DELAY_ON AND NOT_BEEN_RUNNING_OK AND NOT_ALL_OFF) THEN
	STATE := ET_9STATE_MONITORING.START_FAIL;
ELSIF (ENABLE_OFF AND STATUS_ON AND ENABLE_TIMER_OFF AND STOP_DELAY_ON AND ENABLE_TIMER_OFF AND ALL_OFF) THEN
	STATE := ET_9STATE_MONITORING.UNEXPECTED_START;
ELSIF (ENABLE_ON AND STATUS_OFF AND START_DELAY_ON AND FIRE_OFF AND ENABLE_TIMER_OFF AND BEEN_RUNNING_OK AND NOT_ALL_OFF) THEN
	STATE := ET_9STATE_MONITORING.UNEXPECTED_STOP;
ELSIF (ENABLE_OFF AND STATUS_ON AND ENABLE_TIMER_ON AND STOP_DELAY_OFF AND FIRE_OFF) THEN
	STATE := ET_9STATE_MONITORING.STOPPING;
ELSIF (ENABLE_ON AND STATUS_ON) THEN
	STATE := ET_9STATE_MONITORING.RUNNING;
ELSIF (ENABLE_ON AND STATUS_OFF AND ENABLE_TIMER_ON AND START_DELAY_OFF AND FIRE_OFF) THEN
	STATE := ET_9STATE_MONITORING.STARTING;
ELSIF (ENABLE_OFF AND STATUS_OFF) THEN
	STATE := ET_9STATE_MONITORING.STOPPED;
ELSE
	STATE := ET_9STATE_MONITORING.UNKNOWN;
END_IF;

